def get_bing(list1,list2):
#取并集
	t=[]
	for row in list1:
	    if row not in t:
	        t.append(row)
	        
	for row in list2:
		if row not in t:
			t.append(row)
	
	return t

def k_gram(seq,k):
#取出所有长度为k的子序列
	seq_list=[]
	if k>len(seq):
		return seq_list
	else:
		for i in range(0,len(seq)-k+1):
			seq_list.append(seq[i:i+k])

	return seq_list

def get_cos_sim(list1,list2,k):
#计算余弦距离
	l1=k_gram(list1,k)
	l2=k_gram(list2,k)
	
	t=get_bing(l1,l2)
	
	c1=[]
	c2=[]
	
	for l in t:
		num1=0
		num2=0
		for row in l1:
			if row==l:
				num1+=1
		for row in l2:
			if row==l:
				num2+=1
		c1.append(num1/len(l1))
		c2.append(num2/len(l2))
	
	sum1=0
	sum_c1=0
	sum_c2=0
	for i in range(0,len(c1)):
		sum1+=c1[i]*c2[i]
		sum_c1+=c1[i]**2
		sum_c2+=c2[i]**2

	cos=sum1/((sum_c1**0.5)*(sum_c2**0.5))
	
	if cos>1:
		cos=1
	
	arcos=math.acos(cos)/math.pi
	
	return arcos

