def get_Leven(dicts):
#用编辑距离计算相似度矩阵
    Matrix = np.zeros((len(dicts), len(dicts)))
    for i, no_i in enumerate(dicts):
        print(i)
        for j, no_j in enumerate(dicts):
            if j>i:
                break
			
            if i==j:
                pass
            else:
                Matrix[i][j]=1-Levenshtein.seqratio(dicts[no_i], dicts[no_j])
                Matrix[j][i]=Matrix[i][j] 

    return Matrix

def get_Cos(dicts,k):
#用公共子序列+余弦距离计算相似度矩阵
    Matrix = np.zeros((len(dicts), len(dicts)))
    for i, no_i in enumerate(dicts):
        print(i)
        for j, no_j in enumerate(dicts):
            if j>i:
                break
			
            if i==j:
                pass
            else:
                Matrix[i][j]=get_cos_sim(dicts[no_i], dicts[no_j],k)
                Matrix[j][i]=Matrix[i][j]
    return Matrix


